def BFS(edges, start, s, t):
    queue = collections.deque([(start, 0)])
    visited = [False] * (n+1)
    visited[start] = True
    while queue:
        node, dist = queue.popleft()
        if node == t:
            return dist
        for neighbor in edges[node]:
            if not visited[neighbor]:
                visited[neighbor] = True
                queue.append((neighbor, dist+1))
    return float('inf')

