            if edge[0]==x:
                neighbor=edge[1]
            else:
                neighbor=edge[0]
            if neighbor!=y:
                if neighbor not in visited:
                    intersection=dfs(edges,neighbor,y,path1,path2,visited)
                    if intersection>0:
                        return intersection+1
            else:
                intersection=1
                return intersection
    return 0

