def bfs(start, end, g):
    visited = [False] * n
    visited[start] = True
    q = deque([start])
    dist = [0] * n
    while q:
        node = q.popleft()
        if node == end:
            return dist[node]
        for i in range(n):
            if not visited[i] and g[node][i] > 1:
                visited[i] = True
                dist[i] = dist[node] + 1
                q.append(i)
    return []

