def is_elegant(num):
    prime_factors = []
    while num % 2 == 0:
        prime_factors.append(2)
        num //= 2
    while num % 3 == 0:
        prime_factors.append(3)
        num //= 3
    while num % 5 == 0:
        prime_factors.append(5)
        num //= 5

    if num == 1:
        return gcd(prime_factors) == 1
    else:
        return False

