    n, k = map(int, input_string.split())
    preferences = list(map(int, input_string.split()[1:])

    # Convert the preferences to a dictionary where each participant is the key and their preference is the value
    preferences_dict = {}
    for i in range(n):
        preferences_dict[i+1] = preferences[i]

    # Create a list to keep track of which participants have already been assigned to spots
    assigned = [False] * n

    # Keep track of the number of participants assigned to spots
    assigned_count = 0

    # Keep track of the maximum number of participants who can join the excursion
    max_participants = 0

    # Loop through the participants and their preferences
    for participant, preference in preferences_dict.items():
        # If the participant is already assigned to a spot, skip them
        if assigned[participant-1]:
            continue
        # If the preferred participant is already assigned, assign the current participant to a spot
        if assigned[preference-1]:
            assigned[participant-1] = True
            assigned_count += 1
            max_participants += 1
        # If the preferred participant is not assigned, assign the next available spot to the current participant
        else:
            for i in range(k):
                if not assigned[i]:
                    assigned[i] = True
                    assigned_count += 1
                    break

    # Loop through the remaining unassigned participants and assign them spots if possible
    for participant in range(n):
        if not assigned[participant]:
            for i in range(k):
                if not assigned[i]:
                    assigned[i] = True
                    assigned_count += 1
                    break

    # Check if all participants have been assigned
    if assigned_count == n:
        return n
    else:
        return max_participants

