        x, y, l = map(int, input_string.split())
        graph[x][y] = l
        graph[y][x] = l

    # Helper function for Dijkstra's algorithm
    def dijkstra(graph, source):
        dist = {node: float('inf') for node in graph}
        dist[source] = 0
        prev = {node: None for node in graph}
        nodes = set(graph.keys())
        while nodes:
            u = min(nodes, key=lambda node: dist.get(node, float('inf'))
            if u == float('inf'):
                break
            nodes.remove(u)
            for v in graph[u]:
                alt = dist[u] + graph[u][v]
                if alt < dist[v]:
                    dist[v] = alt
                    prev[v] = u
        return dist, prev

    # Find the cheapest path between every building and every building (including itself) using Dijkstra's algorithm
    min_cost = float('inf')
    for building in graph:
        if building not in insecure_buildings:
            costs, _ = dijkstra(graph, building)
            min_cost = min(min_cost, max(costs.values()))

