        return 0
    elif bulbs_removed == n:
        return n
    else:
        odd = []
        even = []
        for i in range(n):
            if bulbs[i] % 2 == 0:
                even.append(i)
            else:
                odd.append(i)
        even.sort()
        odd.sort()
        min_complexity = float('inf')
        for i in range(len(even) - bulbs_removed + 1):
            for j in range(len(odd) - bulbs_removed + 1):
                even_temp = even[:i]
                odd_temp = odd[:j]
                if i + j == bulbs_removed:
                    continue
                complexity = i + j
                for k in range(i + j, len(even) - bulbs_removed):
                    even_temp.append(even[k])
                for k in range(j, len(odd) - bulbs_removed):
                    odd_temp.append(odd[k])
                if complexity < min_complexity:
                    min_complexity = complexity
        return min_complexity

