        dist[y][x] = 1

    for i in range(1, n+1):
        for j in range(1, n+1):
            for k in range(1, n+1):
                dist[i][k] = min(dist[i][k], dist[i][j] + dist[j][k])

    # Calculate the total distance of the shortest path between each pair of universities
