    s = input()
    op = {'+': '+', '-': '-'}
    stack = []
    for c in s:
        if c.isdigit():
            stack.append(c)
        else:
            if not stack:
                stack.append(c)
            else:
                # calculate the result of previous operations
                while len(stack) > 1:
                    a = stack.pop()
                    b = stack.pop()
                    c = stack.pop()
                    if c == '+':
                        stack.append(str(min(255, int(a) + int(b))) if b == '+' else str(max(0, int(a) - int(b))) if b == '-' else str(min(255, int(a) - int(b))) if a == '+' else str(max(0, int(b) - int(a))) if a == '-' else 0)
                stack.append(c)
                # push current operation
                stack.append(op[c])
    # calculate the last operation
    a = stack.pop()
    b = stack.pop()
    c = stack.pop()
    if c == '+':
        result = str(min(255, int(a) + int(b)) if b == '+' else str(max(0, int(a) - int(b)) if b == '-' else str(max(0, int(b) - int(a))) if a == '+' else 0)
    else:
        result = str(min(255, int(a) - int(b)) if b == '+' else str(max(0, int(a) - int(b)) if b == '-' else str(max(0, int(b) - int(a)) if a == '+' else 0)
    return '>' * len(result) + '+' * int(result) + '<[<+>-]'

