    S_pos = [(i,j) for i in range(N) for j in range(M) if matrix[i][j] == 'S'][0]
    S_x, S_y = S_pos[0], S_pos[1]
    time = 0

    # DFS to find the quickest escape path
    def dfs(x, y, time):
        if x < 0 or x > N-1 or y < 0 or y > M-1:
            return float('inf')
        if matrix[x][y] == '1':
            return float('inf')
        if time >= t:
            return float('inf')
        if matrix[x][y] == 'U' and x > 0:
            return float('inf')
        if matrix[x][y] == 'D' and x < N-1:
            return float('inf')
        if matrix[x][y] == 'R' and y < M-1:
            return float('inf')
        if matrix[x][y] == 'L' and y > 0:
            return float('inf')
        if matrix[x][y] == '0':
            return time
        if (x, y) == (N-1, M-1):
            return 0
        time += 1
        return min(dfs(x+1, y, time), dfs(x-1, y, time), dfs(x, y+1, time), dfs(x, y-1, time))

    ans = dfs(S_x, S_y, time)
    if ans == float('inf'):
        return "NOT POSSIBLE"
    else:
        return ans

